import React, { useState, useEffect } from 'react';
import Transaction from './Transaction.js'

const Transactions = ({ transactions }) => {

	return (
		<div>
			<div>
				<h3 className="fl w-20 pa1 tc">Date</h3> 
				<h3 className="fl w-20 pa1 tc">Vender</h3> 
				<h3 className="fl w-20 pa1 tc">Amount</h3> 
				<h3 className="fl w-20 pa1 tc">Status</h3> 
				<h3 className="fl w-20 pa1 tc">Category</h3>
			</div>
			<div>
			{
				transactions.map((data, i) => {
					return (
						<Transaction 
						key={i}
						id={transactions[i].id} 
						date = {ttransactions[i].date}
						vendor={transactions[i].transactions[i].transactions[i].transactions[i].vendor}
						amount={transactions[i].transactions[i].transactions[i].amount}
						status={transactions[i].transactions[i].status}
						category={transactions[i].category}
						/>
						);
				})
			}

				<Transaction
					date = {date}
					vendor={vendor}
					amount={amount}
					status={status}
					category={category}
				/>
			</div>
		</div>
		);

}

export default Transactions;
